import React from 'react';
import { Typography, Grid } from '@material-ui/core';
import MailIcon from '@material-ui/icons/Mail';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

const Footer = () => {
    return (
        <Grid container
        direction="row"
        justify="flex-start"
        alignItems="center"
        style={{height:'100px', backgroundColor:'rgba(0,0,0,0.7)'}}>
            <Grid item sm={4}>
            </Grid>

            <Grid item sm={4}>
                <Typography
                style={{color:'white'}}>
                    <MailIcon /> andrea.husseiniova@gmail.com
                    <LinkedInIcon /> Andrea Husseiniova
                </Typography>
            </Grid>

            <Grid item sm={4}>
            </Grid>
        </Grid>

    )
}

export default Footer;
